 import style from './Card.module.css'

 const Card = ({id, name, status, species, gender, origin, image, onClose}) => {

   return (
      <div className={style.carta}>
             <img className={style.imagen} src={image} alt="" />
             <p>Name: "{name}"</p>
             <p>Status: "{status}"</p>
             <p>Species: "{species}"</p>
             <p>Gender: "{gender}"</p>
             <p>Origin: "{origin}"</p>
             <button onClick={()=> {onClose(id)}}>Close</button>

      </div>
   );
};

export default Card
